import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

function myCard(val){
    return(
        <Card
                imgsrc = {val.imgsrc}
                title = {val.title}
                price = {val.price}
                
                />
    )
}

function App(){
    return(
        <>
            <h1 className="heading"> Here Are Some Product List </h1>
            {Sdata.map(myCard)};
        </>
    );
};

export default App;
